import React , { useEffect , useState } from "react";
import Loading from './Loading';

function Test () {

	const [ loading , setLoading ] = useState( false );
	const [ elLibro , setElLibro ] = useState([]);

	useEffect(( libro ) => {
		
		setLoading( true );
	
		var nombre_libro = "porota";
		var nombre_libro = "papelucho";
		const api = `https://www.googleapis.com/books/v1/volumes?q=${ nombre_libro }`;
		
		fetch( api )
		.then( libro => libro.json() )
		.then( libro => {
			// console.log( libro );
			
			var todo = [];
			
			for ( var count = 0; count <= libro.items.length-1; count++ ) {
				
				var resumen = libro.items[ count ];
				
				todo.push({ 
					"autor" : resumen.volumeInfo.authors , 
					"descripcion" : resumen.volumeInfo.description , 
					"id" : resumen.id , 
					"imagen" : resumen.volumeInfo?.imageLinks ? resumen.volumeInfo.imageLinks.thumbnail : "https://ouch-cdn2.icons8.com/DP-WOV6CKiyzfKpw4jgLyhW1t0lCk3ca-WuruEH9ZHY/rs:fit:455:456/czM6Ly9pY29uczgu/b3VjaC1wcm9kLmFz/c2V0cy9zdmcvMjU1/LzM3OGRkMjBjLWQ5/OGMtNGE3ZS1hYTQx/LWY3NDg0NjQwYzk2/Mi5zdmc.png" , 
					"nombre" : resumen.volumeInfo.title , 
					"editorial" : resumen.volumeInfo.publisher === undefined ? "No especificada" : resumen.volumeInfo.publisher ,
					"categoria" : resumen.volumeInfo.categories === undefined ? "No especificada" : resumen.volumeInfo.categories ,
					"publicado" : resumen.volumeInfo.publishedDate ,
					"isbn_10" : resumen.volumeInfo.industryIdentifiers[ 0 ].identifier ,
					"isbn_13" : resumen.volumeInfo.industryIdentifiers[ 1 ].identifier ,
					"paginas" : resumen.volumeInfo.pageCount ,
					"idioma" : resumen.volumeInfo.language ,
					"preview" : resumen.volumeInfo.previewLink ,
					"venta" : {
						"precio" : resumen.saleInfo.listPrice === undefined ? "No especificado" : `$ ${resumen.saleInfo.listPrice.amount}` ,
						"peso" : resumen.saleInfo.listPrice === undefined ? "" : resumen.saleInfo.listPrice.currencyCode ,
						"comprar" : resumen.saleInfo.buyLink === undefined ? "" : <li><a target="_blank" rel="noreferrer" href="${ resumen.saleInfo.buyLink }">Comprar</a></li> ,
						
					} ,
				});

			};
			
			setElLibro( todo );
			setLoading( false );

		});
		
	},[]);
	
	if ( loading ) {
		return (
			<section className="test">
				<h2>Libros</h2>
				<Loading />
			</section>
		);
	};

	return (
		<section className="test">
			<h2>Libros</h2>
			<div className="libros">
				{
					elLibro.map( ( librito ) => {
						return (
								<div className="libro" key={ librito.id }>
									<img style={{ width: '128px' }} src={ librito.imagen } alt={ librito.nombre } />
									<ul>
										<li>Libro: { librito.nombre }</li>
										<li>Autor: { librito.autor }</li>
										<li>Editorial: { librito.editorial }</li>
										<li>Publicado: { librito.publicado }</li>
										<li>Categoria: { librito.categoria }</li>
										<li>ISBN 10: { librito.isbn_10 }</li>
										<li>ISBN 13: { librito.isbn_13 }</li>
										<li>Paginas: { librito.paginas }</li>
										<li>Idioma: { librito.idioma }</li>
										<li>
											<a target="_blank" rel="noreferrer" href={ librito.preview }>Preview</a>
										</li>
										<li>Precio: { librito.venta.precio } { librito.venta.peso }</li>
										{ librito.venta.comprar }
									</ul>
									<p>{ librito.descripcion }</p>
								</div>
						);
					})
				}
			</div>
			
			
			
		</section>
	);
};

export default Test;
